import "../node_modules/bootstrap/dist/css/bootstrap-grid.min.css";
const RoomNum = (props) => {
    console.log(props.total);
    var list = [];
    for (var i = 1; i <= props.total; i++) {
      list.push(i);
    }
  return (  
    <div>

    {list.map(function(i){
        return (<div >
            <h4>Room-{i}</h4>
            <div class="col-md-offset-5 col-md-5 d-flex">
                <label for="ex1">Adults</label>
                <input type="number" className="col-md-5" name="adults" id=""/>


            </div>



        </div>)
    })}


    </div>
  );
};
export default RoomNum;
